import React from 'react';
import styled from '@emotion/styled';

const Aloud = styled.span`
    font-family: 'Josefin Sans';
    color: #FF331F;
    font-size: 10vh;
    font-weight: 100;
`

const Logo = () => {

    return(
        <>
        <Aloud>aloud</Aloud>
        </>
    )
}

export default Logo;
